import './Component1.css';

function Component1(props) {
    return (
        <div className='full'>
            <div className='Leftside'>
                <h6 className='datestyle'>{props.date.toISOString()}</h6>
                <h3 className='titlestyle'>{props.title}</h3>
            </div>
            <div className='rightside'>
                <div className='pricestyle'>${props.price}</div>
                <img src={props.image} alt='o'/>
               {/* <div className='imagestyle'>{props.image}</div> */}
                <div className='imagestyle'>{props.image}</div> 

            </div>
        </div>
    );
}

export default Component1;
